import React from 'react'
import Frontslide from '../component/Frontslide'

function Home() {
    return (
    <section className='video-place'>
        <video src='\video\19598792-hd_1080_1920_30fps.mp4' autoPlay loop muted/>

        <section className='video-sec'>
            <Frontslide/>
        </section>
        
    </section>

    )
}

export default Home
